import React from 'react';
import Spinner from 'react-spinkit';

import '../styles/Load.css';

export default function Load({ show }) {
    return (
        show
            ? <div className="load-content">
                <Spinner
                    name='pacman'
                    fadeIn='none'
                    color='white'
                />
            </div>
            : null
    );
}
